import React from 'react';
import classes from './bio.module.css'
import myPhoto from '../../assets/me.png'
import TelegramIcon from '@mui/icons-material/Telegram';
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';
import LocalPhoneIcon from '@mui/icons-material/LocalPhone';

const Bio = () => {
    const openInNewTab = (url: string) => {
        const newWindow = window.open(url, '_blank', 'noopener,noreferrer')
        if (newWindow) newWindow.opener = null
    }
    return (
        <div className={classes.mainCont}>
            <div className={classes.leftSide}>
                <div className={classes.firstSect}>
                    <img className={classes.myPhoto} alt={"my img"} src={myPhoto}/>
                </div>
            </div>
            <div className={classes.rightSide}>
                <div className={classes.firstSect}>
                    <p className={classes.surname}>Melnikov</p>
                    <p className={classes.name}>Kirill</p>
                    <span className={classes.jobPref}>Web Developer & Front-end Junior</span>
                    <div className={classes.iconsCont}>
                        <TelegramIcon onClick={() => openInNewTab("https://t.me/howareyadoin")} className={classes.icon}/>
                        <GitHubIcon className={classes.icon}/>
                        <EmailIcon className={classes.icon}/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Bio;
